/**
 * Finds the minimum value in an iterable of numbers.
 * @param {Iterable<number>} iterable - The input iterable of numbers.
 * @returns {number} The minimum value, or Infinity if the iterable is empty.
 *
 * @example
 * const numbers = [3, 1, 4, 1, 5, 9, 2, 6];
 * console.log(iMin(numbers)); // 1
 */
export function iMin(iterable: Iterable<number>): number;
